import React from "react";
import RowCell from "../TableBody/TableRow/RowCell";

const TableHead = (props) => {
   const heads = matrix.map((item, index) => {
      if (index > 0) {
         return <RowCell key={index} value={"col " + index}></RowCell>;
      }
   });

   return <thead>{heads}</thead>;
};

export default TableHead;
